import React, { Component } from 'react';

import './CSS/App.css';

import Faker from 'faker';
import Container from './components/modalContiners/container';
import { Grid, Row, Col } from 'react-flexbox-grid';
import NavBar from './components/NavBar';




const apiURL = 'http://localhost:4000/shopping';
class App extends Component {

  constructor(props)
  {
    super(props);

    this.state = {
      data:[],
    }
  }

  async componentDidMount()
  {
    // const response = await fetch(apiURL)
    //   .then((response) => response.json())
    //   .then((data) => {
    //     this.setState({data});
    //   });
    //   console.log(this.state.data)
    let data = this.getFakerData();
    this.setState({data});
  }

  getFakerData(){
    const total=32;
    let counter;
    const response = [];

    for(counter = 0; counter<total;counter++)
    {
      response[counter] = {}
      response[counter]["_id"] = counter.toString();
      response[counter]["product_name"]= Faker.commerce.productName();
      response[counter]["product_description"]= Faker.lorem.sentence();
      response[counter]["product_price"]= Faker.commerce.price();
      response[counter]["product_quantity"] = Faker.random.number();
      response[counter]["product_images"]= this.imageArray();
    }
    return response;

  }




  imageArray()
  {
    let imageArray = [];
    let range = Math.floor(Math.random() * 5) + 3;
    for(let i =0; i<=range;i++)
    {

      imageArray.push(Faker.internet.avatar());
    }

    return imageArray;
  }


  render() {
    return (
      <div className="App">
        <Grid className='appGrid'>
          <Row className='headerRow'>
            this
          </Row>
          <Row className='bodyRow'>
            <Col className='bodyRowSidePane'>this</Col>
            <Col className='bodyRowMainView'>
              {this.state.data.map(product => (
                <Row className='product' xs={12} sm={5} lg={3} key={product._id.toString()} >
                  <Container 
                    triggerText={product.product_name} 
                    triggerType={'image'} 
                    formType={'product'} 
                    info={product} 
                    triggerImage={product.product_images[0]}
                    style={{width: "200px",height:"100px"}} />
                    <div>{product.product_name}</div>

                </Row>
                ))}
            </Col>
          </Row>
          <Row className='footerRow'>
            this
          </Row>
        </Grid>





        <Grid className = "Grid">
          <Row>
            
            <Col xsOffset={10} xs={1}>
            <NavBar style={{float:'left'}}/>
            </Col>
            <Col xsOffset={11} xs={1} style = {{float:'left'}}>
            <Container 
              className = "Login"
              style={{
                width: 'auto',
                borderRadius: 'auto',}}
              style={{float:"left"}}
              triggerText={'Login'} 
              triggerType={'button'} 
              formType={'login'} />
            
            <Container 
              triggerText={'Register'} 
              triggerType={'button'} 
              formType={'register'}
              style={{clear:'both',float:"left"}}/>
            </Col>
          </Row>

          <Row>
          <Container 
            triggerText={'Cart'} 
            triggerType={'button'} 
            formType={'cart'} 
            style={{float:"left"}}/>
          </Row>


          <Row className="productContainer">
          {this.state.data.map(product => (
            <Col className='product' xs={12} sm={5} lg={3} key={product._id.toString()} >
              <Container 
                          triggerText={product.product_name} 
                          triggerType={'image'} 
                          formType={'product'} 
                          info={product} 
                          triggerImage={product.product_images[0]}
                          style={{width: "200px",height:"100px"}} />
            <div>{product.product_name}</div>

            </Col>
            
          ))
          }
          
          </Row>
        </Grid>
      </div>

    );
  }
}

export default App;
